function SettingsTowerCrane() {
  return (
    <>
      <Box sx={{
          position: 'relative', 
          width: 415,
          maxWidth: 415,
          paddingBottom: '100px',
          boxShadow: '3px 3px 7px rgba(103, 162, 206, 0.2)', 
          zIndex: 5,
        }}
      >
        <Box sx={{
          display: 'flex',
          height: 65,
          borderBottom: 2,
          borderColor: '#edf2f6',
        }}>

        </Box>
        <Box sx={{
          display: 'flex',
          height: 'calc(100% - 65)',
        }}>
          <Box sx={{
            display: 'flex',
            backGroundColor: 'red'
          }}>
            <Box sx={{
              display: 'flex',
              flexDirection: 'column'
            }}>
              <Box sx={{padding: '15px 20px', borderBottom: 2, borderColor: '#edf2f6'}}>
                <Typography sx={{color: '#889ab1'}}>Search Tower Cranes...</Typography>
              </Box>
              <Box sx={{backGroundColor: 'red', width: 415}}>

              </Box>
            </Box>
            <Box sx={{backgroundColor: 'green', position: 'fixed', bottom: 0, height: 100, display: 'block'}}>

            </Box>
          </Box>
        </Box>
      </Box>
    </>
  );
}

export default SettingsTowerCrane;
